item.description:
The McChicken® is a delightfully crispy chicken sandwich with a crispy chicken fillet topped with mayonnaise, shredded iceberg lettuce, and served on a perfectly toasty bun.*  &#13;
<br><br>&#13;
*Available at participating restaurants

item.item_ingredient_statement:
Crispy Chicken Breast Filet: Boneless skinless chicken breast filet with rib meat containing up to 19.5% of a solution of water, seasoning (salt, spices and spice extractive), sodium phosphates. Battered and breaded with wheat flour, water, modified corn starch, salt, spice, dried egg white, wheat gluten, and leavening (sodium acid pyrophosphate, sodium bicarbonate, monocalcium phosphate). Breading set in vegetable oil. Cooked in partially hydrogenated vegetable oils, (may contain partially hydrogenated soybean oil and/or partially hydrogenated corn oil and/or partially hydrogenated canola oil and/or cottonseed oil and/or sunflower oil and/or corn oil). &#13;
&#13;
Salad Mix: Iceberg lettuce, romaine lettuce, spring mix (may contain baby red romaine, baby green romaine, baby red leaf, baby green leaf, baby red swiss chard, baby red oak, baby green oak, lolla rosa, tango, tatsoi, arugula, mizuna, baby spinach, radicchio, frisee), carrots.&#13;
&#13;
Cheddar /Jack Cheese: Mild cheddar cheese (cultured pasteurized milk, salt, enzymes, artificial color), Monterey Jack cheese (cultured pasteurized milk, salt, enzymes), &#13;
powdered cellulose added to prevent caking, natamycin (a natural mold inhibitor).&#13;
&#13;
Bacon Bits: Cured with water, salt, smoke flavoring, sodium phosphate, seasoning [gum acacia, smoke flavor, maltodextrin, hydrolyzed corn protein, natural flavor (vegetable source), autolyzed yeast extract, hydrolyzed corn, wheat, and soy protein, modified cornstarch, contains less than 2% of disodium guanylate, disodium inosinate, natural flavor (vegetable oil), salt, succinic acid, xanthan gum], sodium erythorbate, sodium nitrite. &#13;
&#13;
Grape tomatoes.
